explanation = '<MA>CHILE and SOUTH AFRICA</MA><TEXT>All of the countries on Matt\'s supposed trip are placed symmetrically in the grid (with NAMIBIA in the center), with the exception of 10-Down, BRAZIL. The symmetric counterpart of 10-Down, 44-Down, is the non-thematic MILLER. However, the clue for MILLER, {"Tropic of Capricorn" novelist Henry}, provides a hint to what the theme answers have in common: they all lie on the Tropic of Capricorn. Only ten countries in the world do so, and eight of them are in the grid. The remaining two are the answers.</TEXT>'
